import React, { useState, useEffect } from "react";
import CompanyCamIntegration from "./CompanyCamIntegration";

const ProjectDetailsPage: React.FC<{projectId: string; onBack: () => void}> = ({ projectId, onBack }) => {
  const [project, setProject] = useState<any>(null);
  const [files, setFiles] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);
  const [uploading, setUploading] = useState(false);

  useEffect(() => {
    Promise.all([
      fetch(`http://localhost:5000/api/projects/${projectId}`).then(res => res.json()),
      fetch(`http://localhost:5000/api/projects/${projectId}/files`).then(res => res.json())
    ]).then(([projectData, filesData]) => {
      setProject(projectData.project);
      setFiles(filesData.files || []);
      setLoading(false);
    }).catch(err => {
      setLoading(false);
    });
  }, [projectId]);

  const handleFileUpload = async (event: React.ChangeEvent<HTMLInputElement>) => {
    const selectedFiles = event.target.files;
    if (!selectedFiles) return;

    setUploading(true);

    for (let file of Array.from(selectedFiles)) {
      try {
        const response = await fetch(`http://localhost:5000/api/projects/${projectId}/files`, {
          method: 'POST',
          headers: {'Content-Type': 'application/json'},
          body: JSON.stringify({
            filename: file.name,
            fileType: file.type.includes('image') ? 'photo' : 'document'
          })
        });

        if (response.ok) {
          const newFile = await response.json();
          setFiles(prev => [...prev, newFile]);
        }
      } catch (error) {
        alert(`Failed to upload ${file.name}`);
      }
    }

    setUploading(false);
  };

  if (loading) return <div className="p-8">Loading...</div>;
  if (!project) return <div className="p-8">Project not found</div>;

  return (
    <div className="p-8">
      <button onClick={onBack} className="bg-gray-500 text-white px-4 py-2 rounded mb-4">
        ← Back to Queue
      </button>
      <h1 className="text-2xl font-bold mb-4">Project Details</h1>

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="font-bold mb-4">Project Information</h2>
          <p><strong>Contractor:</strong> {project.contractor.companyName}</p>
          <p><strong>Property:</strong> {project.propertyAddress}</p>
          <p><strong>Owner:</strong> {project.propertyOwnerName}</p>
          <p><strong>Status:</strong> {project.status}</p>
          <p><strong>Fee:</strong> ${project.totalCost}</p>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="font-bold mb-4">Manual File Upload</h2>
          <input
            type="file"
            multiple
            accept="image/*,.pdf"
            onChange={handleFileUpload}
            disabled={uploading}
            className="w-full border rounded px-3 py-2 mb-4"
          />
          {uploading && <p className="text-blue-600">Uploading...</p>}
          <p className="text-sm text-gray-500">
            For additional documents not in CompanyCam
          </p>
        </div>
      </div>

      <CompanyCamIntegration projectId={projectId} />

      <div className="mt-6 bg-white rounded-lg shadow p-6">
        <h2 className="font-bold mb-4">All Project Files ({files.length})</h2>
        <div className="space-y-2">
          {files.map(file => (
            <div key={file.id} className="flex justify-between items-center p-2 border rounded">
              <span>{file.filename}</span>
              <span className="text-sm text-gray-500">
                {file.source === 'companycam' ? 'CompanyCam' : 'Manual Upload'}
              </span>
            </div>
          ))}
          {files.length === 0 && (
            <p className="text-gray-500">No files yet - sync from CompanyCam or upload manually</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default ProjectDetailsPage;
